import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import React from 'react';
import Header from "./Components/Header";
// import GetPlayers from "./Components/GetPlayers";
// import AddPlayers from "./Components/AddPlayers";
// import DeletePlayers from "./Components/DeletePlayers";
// import UpdatePlayers from "./Components/UpdatePlayers";
// import Page404 from './Components/Page404';
// import Home from "./Components/Home";
import View from "./Components/View";
import Add from "./Components/Add";
import Login from "./Components/Login";
import DemoGetData from './Components/DemoGetData';
import Viewfav from './Components/Viewfav';
import ForgotPassword from './Components/ForgotPassword';
import ResetPassword from './Components/ResetPassword';
import RegistrationForm from './Components/RegistrationForm';
import AddBus from './Components/AddBus';

const Routes = () => {

    return (
        <div>
            <Router>
                <div>
                    <Header />
                    <div>
                    <Switch>
                            <Route exact path="/" > <Login /> </Route>
                            <Route exact path="/get" > <View /> </Route>
                                                        <Route exact path="/get" > <View /> </Route>

                            <Route path="/post" > <Add /></Route>
                            <Route path="/demodata" > <DemoGetData /></Route>
                            <Route path="/viewfav" > <Viewfav /></Route>
                            <Route path="/forgotpassword" > <ForgotPassword /></Route>
                            <Route path="/resetpassword" > <ResetPassword /></Route>
                            <Route path="/registration" > <RegistrationForm /></Route>
                            <Route path="/addbus" > <AddBus /></Route>
                            </Switch>
                    </div>

                </div>
            </Router>
        </div>
    );

}
export default Routes;
